import React from "react";

interface HeaderBarProps {
    headerIcon: string;
}

const HeaderBar: React.FC<HeaderBarProps> = ({ headerIcon }) => {
    return (
        <header className="header-bar">
            <img src={headerIcon} alt="Header Icon" />
            <h1>Header</h1>
        </header>
    );
};

export default HeaderBar;
